import { AppBar, Box, Container, styled, Toolbar, Typography } from "@mui/material"
import MenuIcon from "@mui/icons-material/Menu"

export const Navigation = () => {
    
    const LinkItem = styled(Typography) (({theme}) => ({
        fontSize: "14px",
        color: "#000",
        fontWeight: "bold",
        cursor: "pointer",
        "&:hover":{
            color: "#fff"
        }
    }));

    const LinkItemsBox = styled(Box) (({theme}) => ({
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        gap: theme.spacing(3),
        [theme.breakpoints.down("md")]: {
            display: "none"
        }
    }));

    const NavIcon = styled(MenuIcon) (({theme}) => ({
        display: "none",
        cursor: "pointer",
        marginRight: theme.spacing(2),
        [theme.breakpoints.down("md")]: {
            display: "block"
        }
    }));

    const NavContainer = styled(Container) (({theme}) => ({
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        padding: theme.spacing(5),
        [theme.breakpoints.down("md")]: {
            padding: theme.spacing(2)
        }
    }));

    const NavLogo = styled("img") (({theme}) => ({
        cursor: "pointer",
        [theme.breakpoints.down("md")]: {
            display: "none"
        }
    }));

    return (
        <NavContainer>
            <Box sx={{display:"flex", alignItems:"center", justifyContent: "center", gap: "2,5rem"}}>
                <Box sx={{display:"flex", alignItems:"center"}}>
                    <NavIcon />
                    <NavLogo src="../IMGs/Greenweels.png" alt="logo"/>
                </Box>
                <LinkItemsBox>
                    <LinkItem variant="body2">So funktioniert's</LinkItem>
                    <LinkItem variant="body2">Preise</LinkItem>
                    <LinkItem variant="body2">HÃ¤ufige Fragen</LinkItem>
                </LinkItemsBox>
            </Box>
        </NavContainer>
    );
}

export default Navigation;
